 import React, { Component } from 'react';

 class FetchConnectApi extends Component {
    constructor(props) {
        super(props)
        this.state = {
            response: []
        }
    }

    componentDidMount() {
        fetch('https://www.reddit.com/r/nonbinary.json')
        .then(response => { if (!response.ok)
        { throw Error("Network request failed") }

        return response;
        })
        .then(jobs => jobs.json())
        .then(jobs => {
        this.setState({
        response: jobs
        })
        }, () => {
        this.setState({
        requestFailed: true
        })
        })
    }

    render() {
        const dataObj = "";
        if (this.state.requestFailed) 
        {
            return <p>Failed!</p>
        }
            
        if (!this.state.results) 
        {
            return <p>success.
                {JSON.parse(this.state.response)}
            </p>

        }
        return (
            <div>
            null
            </div>
        )
    } 
}

 export default FetchConnectApi;
